`;

export const TitleG1 = styled.Text`
  background-color: #C4170C;
  width: 100%;
  font-weight: bold;
  text-align: center;
  margin-top: 10px;
  padding: 10px;
  font-size: 20px;
  color: #fff;
  line-height: 21px;
`;

export const TitleGe = styled.Text`
  background-color: #3b9c00;
  width: 100%;
  padding: 10px;
  font-weight: bold;
  text-align: center;
  margin-top: 10px;
  font-size: 20px;
  color: #fff;
  line-height: 21px;
`;

export const TitleGs = styled.Text`
  background-color: #ec7d00;
  width: 100%;
  padding: 10px;
  font-weight: bold;
  text-align: center;
  margin-top: 10px;
  font-size: 20px;
  color: #fff;
  line-height: 21px;
`;

export const ProductList = styled(FlatList)`
  flex: 1;
`;

export const Button = styled.TouchableOpacity`
  background-color: #398ad7;
  border-radius: 3px;
  height: 44px;
  padding: 0px 20px;
  margin-top: 10px;
  justify-content: center;
  align-items: center;
`;

export const ButtonText = styled.Text`
  color: #ffffff;
  font-weight: bold;
  font-size: 14px;
`;
